import React from "react";
import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import HomePage from './HomePage'; 
import FinalPage from './finalpage'; 
import Calculate from './calculate'; 
import ReportWebVitals from './reportWebVitals';
function Navbar() {
    return (
        <div style={{ listStyleType: 'none', display: 'flex'}}>
            <div style={{width: "40%", display: 'flex', // 启用Flexbox
                        justifyContent: 'center', // 水平居中
                        alignItems: 'center' }}>
                <text>
                    logo
                </text>
            </div>
            <div style={{width: "30%"}}>

            </div>
            <div style={{width: "30%"}}>
                <nav>
                    <ul style={{ listStyleType: 'none', display: 'flex', justifyContent: 'space-around', padding: 0 }}>
                    <li>
                        <Link to="/" style={{ textDecoration: 'none', color: 'black' }}>home</Link>
                    </li>
                    <li>
                        <Link to="/calculate" style={{ textDecoration: 'none', color: 'black' }}>calculate</Link>
                    </li>
                    <li>
                        <Link to="/final" style={{ textDecoration: 'none', color: 'black' }}>knowlage</Link>
                    </li>
                    <li>
                        <Link to="/reportWebVitals" style={{ textDecoration: 'none', color: 'black' }}>Contact</Link>
                    </li>
                    </ul>
                </nav>
            </div>
        </div>
    );
  }

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/calculate" element={<Calculate />} />
          <Route path="/final" element={<FinalPage />} />
          <Route path="/" element={<HomePage />} />
          <Route path="/final" element={<ReportWebVitals />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
